/**
 * Builds an analyzer with the given stop words 
 * 
 * @param matchversion
 *          lucene compatibility version
 * @param stopwords
 *          a stopword set
 */
public GermanAnalyzer(Version matchVersion, Set<?> stopwords) {
  this(matchVersion, stopwords, CharArraySet.EMPTY_SET);
}

